// Results.js
import React, { useState } from 'react';
import './Results.css';

const Results = () => {
    const [showDetails, setShowDetails] = useState(false);

    const toggleDetails = () => {
        setShowDetails(!showDetails);
    };

    return (
        <div className="results">
            <h3>Resultados del Análisis</h3>
            <div className="graph-container">
                {/* Aquí se puede añadir un gráfico o placeholder */}
                <div className="graph-placeholder">
                    <p>Gráficas del análisis se mostrarán aquí</p>
                </div>
            </div>
            <p>Precisión en la identificación de instrumentos:</p>
            <ul>
                <li><span className="instrument">Quena:</span> <span className="accuracy">85%</span></li>
                <li><span className="instrument">Bombo:</span> <span className="accuracy">78%</span></li>
                <li><span className="instrument">Charango:</span> <span className="accuracy">92%</span></li>
            </ul>
            <button className="andean-button" onClick={toggleDetails}>
                {showDetails ? 'Ocultar detalles' : 'Ver más detalles'}
            </button>
            {showDetails && (
                <div className="details-container">
                    <h4>Detalles del análisis</h4>
                    <p>En esta sección se mostrarán detalles más específicos sobre el análisis realizado con técnicas de machine learning, incluyendo información adicional sobre los datos utilizados, el modelo aplicado y cualquier otro dato relevante.</p>
                </div>
            )}
        </div>
    );
};

export default Results;
